import React from "react";
import { BrowserRouter as Router, Link, Route, Routes } from "react-router-dom";
import { Navigation, Footer, Home, Contact, SignUp, SignIn, Doctprofile } from "./components";

class App extends React.Component {
  constructor() {
    super();
    // this.RouterDoctprofile = this.RouterDoctprofile.bind(this);
  }
  //#region  Routers
  RouterHome() {
    if (true) {
      return (
        <Route exact path="/" element={<Home />} />
      )
    }
  }

  RouterSignUp() {
    if (true) {
      return (
        <Route path="/signup" element={<SignUp />} />
      )
    }
  }
  RouterSignIn() {
    if (true) {
      return (
        <Route path="/signin" element={<SignIn />} />
      )
    }
  }
  RouterContact() {
    if (true) {
      return (
        <Route path="/contact" element={<Contact />} />
      )
    }
  }
  // RouterDoctprofile() {
  //   if (false) {
  //     return (
  //       <Route path="/doctorNotAPP" element={<Doctprofile />} />
  //     )
  //   }
  //   else{
  //     this.props.router.push('/signin');
  //     return(
  //       <Route path="/signin"  element={<SignIn />} />
  //     )
  //   }
  // }
  //#endregion

  render() {
    return (
      <div className="App">
        <Router>
          <Navigation />
          <Routes>
            {this.RouterHome()}
            {this.RouterSignUp()}
            {this.RouterContact()}
            {/* {this.RouterDoctprofile()} */}
            {5>6?
              <Route path="/doctorNotAPP" element={<Doctprofile />} />
              :
              <Link to={''}></Link>
            }
            {this.RouterSignIn()}
          </Routes>
        </Router>
      </div>
    );
  }
}
export default App;
